import React, { useState, useEffect } from 'react';
import { db } from "../../utils/firebaseConfig";


export const CreateProfil = (res) => {

  return db.collection("Profil").doc(res.user.uid).set({
    uid: res.user.uid,
    name: res.user.displayName,
  })
}
